import React from 'react'
import {Card,Image} from "antd";
import {RetweetOutlined} from "@ant-design";

const PostCard = ({post}) =>{
    return(
      <div>
          <Card
              cover={post.Images[0] && <PostImages images={post.images}/>}
              actions={[
                  <RetweetOutlined/>
              ]}
          >
              <Image/>
              <Content/>
              <Buttons></Buttons>
          </Card>
          <CommentForm/>
          <Comments/>
      </div>
    );
};

export default PostCard;
